import React from "react";
import AboutBannerSection from "../component/AboutBannerSection";
import AboutPageContent from "../component/AboutPageContent";
import SocialSection from "../component/SocialSection";

function AboutPage() {
  return (
    <>
      <SocialSection />
      <AboutBannerSection />
      <AboutPageContent />
    </>
  );
}

export default AboutPage;
